INSERT INTO `v1_40d97d555cd6dd974352ffb2da2a5a030c621f4853d106995a46b8c56e58020f` VALUES (1, 100911, "ふふ、やった！　やったぞ！\nまたしても傑作の完成だ！\nみんなの努力が実る、この瞬間……\n何度やっても達成感があるな！", 0, 0, 11, 16612026, 10, 1, 0.5, 16612);
